import React from "react";
import "./index.css";
import {add,sub,mult,divi} from "./Calculation";
function App(){
    return(<>
    <ul className="rm">
        <li>Sum of two no is = {add(12,8)}</li>
        <li>Sub of two no is = {sub(12,8)}</li>
        <li>Mult of two no is = {mult(12,8)}</li>
        <li>Div of two no is = {divi(50,8)}</li>
    </ul>
    </>)
}
export default App;
